ReactDOM.render(
    <>
        <h1 className='heading'>List of Top 5 Netflix Series</h1>



        {Sdata.map(function ncard(val) {
            return (
                <Card
                    imgsrc={val.imgsrc}
                    title={val.title}
                    sname={val.sname}
                    link={val.link}
                />
            )
        })};

    </>
    ,
    document.getElementById('root')
)
